					<Cell span={[12, 12, 9]}>
						<Title title="CLASSROOM" subtitle="Select classroom to read , update , delete" />
					</Cell>
				</Grid>
				</Block>
			</Container>
		</>
	);
};

export default ProtectedRoute( withApollo(ClassRoomsPage ));
